import React from 'react'

export default function decoder(img){
    console.log(typeof img)
    if (img!= 'no image'){
        var image = new Image();
        var cleanImange = String(img).substring(2, img.length - 1)
        image.src = `data:image/png;base64,${cleanImange}`;
        return(image.src)

